import Field from "../forms/Field";
import React from "react";


async function getSessions() {
    try {
        var url = new URL(process.env.REACT_APP_API_URL + '/Report/Session');
        url.searchParams.append('courseName', "CS 17700");

        var myHeaders = new Headers();
        myHeaders.append("Ocp-Apim-Subscription-Key", process.env.REACT_APP_SUBSCRIPTION_KEY);

        var requestOptions = {
            method: 'GET',
            headers: myHeaders,
        };
        const response = await fetch(url, requestOptions);
        if (!response.ok) {
            throw new Error(`Failed to fetch data. Status: ${response.status}`);
        }
        const data = await response.json();
        return data;
    } catch (error) {
        console.error('Error:', error);
    }
}
function Filter(){
    return(
        <>
            <h2>Filter Courses</h2>
            <form onSubmit={getSessions}>
                <Field name={"courseName"} labelName={"Course Name"}></Field>
                <button className="bg-[var(--md-sys-color-primary-container-dark)] hover:bg-[var(--md-sys-color-surface-dark)] text-[var(--md-sys-color-on-primary-container-dark)] font-bold py-2 px-4 rounded-full">
                    Submit
                </button>
            </form>

        </>
    );
}

export default Filter;
